import React from 'react'
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import ClientList from './pages/ClientsList';
import ClientHome from './pages/ClientHome';
import NotFound from './pages/NotFound';
import newAddressByClient from './pages/newAddress';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component= { ClientList }/>
        <Route exact path="/client/:clientId" component= { ClientHome }/>
        <Route exact path="/client/:clientId/newAddress" component={ newAddressByClient }/>
        <Route component={ NotFound } />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
